from django.urls import reverse_lazy, reverse, NoReverseMatchfrom django import templatefrom django.template.loader import get_templateregister = template.Library()@register.simple_tagdef services_menu():    urls = []    try:        url_names = ['new_error', 'error_list']        for url in url_names:            urls.append((url_names,reverse_lazy(url)))            print(url)    except NoReverseMatch:        print("There is no route")    return urls